import styled from 'styled-components'

const BannerImage = styled.img`
  position: absolute;
  width: 100%;
  height: 100%;
  object-fit: cover;
  border-radius: 25px;
  filter: brightness(0.7);
`

function Apropos() {
  return (
    <AproposContainer>
      <BannerImage2 img src={BackgroundImage2} />
    </AproposContainer>
  )
}

export default Apropos
